DROP TABLE IF EXISTS Adressen;

CREATE TABLE Adressen ( 
number INTEGER PRIMARY KEY AUTOINCREMENT, 
 gender varchar(6), 
 company varchar(70), 
 nachname varchar(25), 
 vorname varchar(25), 
 strasse varchar(100), 
 hausnr varchar(5), 
 zusatz varchar(5), 
 plz varchar(10), 
 ort varchar(35), 
 vorwahl varchar(10), 
 telefon varchar(15), 
 email varchar(35), 
 url varchar(35), 
 branche varchar(50), 
 beruf varchar(50)
);

